import Link from 'next/link';

const Navbar = () => (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <ul className="navbar-nav mr-auto">
            <li className="nav-item" >
                <Link href="/"><a className="nav-link">Popular</a></Link>
            </li>
            <li className="nav-item">
                <Link href="/list"><a className="nav-link">List</a></Link>
            </li>
            <li className="nav-item">
                <Link href="/social"><a className="nav-link">Social</a></Link>
            </li>
        </ul>
        <style jsx>{`
            nav {
                border-radius: 0 0 8px 8px;
                box-shadow: 0px 8px 2px -5px rgba(0,0,0,0.75);
                // position: fixed;
                // width: 100%;
                // top: 0;
                // left: 0;
            }
            .navbar-nav {

            }
        `}
        </style>
    </nav>
)

export default Navbar;
